    /**
     * Given a 2D board containing 'X' and 'O', capture all regions surrounded by 'X'.
     * <p/>
     * A region is captured by flipping all 'O's into 'X's in that surrounded region.
     * <p/>
     * For example,
     * X X X X
     * X O O X
     * X X O X
     * X O X X
     * After running your function, the board should be:
     * <p/>
     * X X X X
     * X X X X
     * X X X X
     * X O X X
     *
     * @param board
     */
    public void solve(char[][] board) {
        if (board == null || board.length == 0) {
            return;
        }
        int rowSize = board.length;
        int colSize = board[0].length;
        boolean[][] visited = new boolean[rowSize][colSize];
        ArrayList<Character> current = new ArrayList<Character>();
        for (int i = 0; i < rowSize; i++) {
            for (int j = 0; j < colSize; j++) {
                if (visited[i][j] == false && board[i][j] == 'O') {
                    visited[i][j] = true;
                    boolean result = find(board, visited, i, j);
                    if (result == true) {
                        board[i][j] = 'X';
                    }
                }
            }
        }

    }

    private boolean find(char[][] board, boolean[][] visited, int i, int j) {
        if (i - 1 < 0 || i + 1 >= board.length || j - 1 < 0 || j + 1 >= board[0].length) {
            return false;
        }

        int[] rowStep = {-1, 1, 0, 0};
        int[] colStep = {0, 0, -1, 1};

        for (int t = 0; t < 4; t++) {
            if (visited[i + rowStep[t]][j + colStep[t]] == false &&
                    board[i + rowStep[t]][j + colStep[t]] == 'O') {
                visited[i + rowStep[t]][j + colStep[t]] = true;
                boolean result = find(board, visited, i + rowStep[t], j + colStep[t]);
                if (result == true) {
                    board[i + rowStep[t]][j + colStep[t]] = 'X';
                } else {
                    return false;
                }
            }
        }
        return true;


    }


